import React from 'react';
import CartElement from '../CartElement/CartElement';

const CartContent = ({ cartItems }) => {
  return (
    <div className="cart-content">
      {cartItems.map((item) => (
        <CartElement key={item.id} item={item} />
      ))}
    </div>
  );
};

export default CartContent;
